public class IsSubsequence {

    public static boolean isSubsequence(String s, String t) {

        if(s.length() == 0) return true;

        int count = 0;
        for(int i = 0; i < t.length(); i++){
            if(s.charAt(count) == t.charAt(i)){
                count++;
            }
            if(count == s.length())
                break;
        }

        return count == s.length();
    }

    public static boolean isSubsequencefast(String s, String t) {

        if(s.length() == 0) return true;

        int prev = -1;
        for(int i = 0; i < s.length(); i++){
            int tmp = t.indexOf(s.charAt(i), prev +1);
            if( tmp == -1){
                return false;
            }
            prev = tmp;
        }

        return true;
    }

    public static void main(String args[]){
        System.out.println(isSubsequencefast("abc", "ahbgdc") == true?"SUCCES":"ERROR");
        System.out.println(isSubsequencefast("axc", "ahbgdc") == false?"SUCCES":"ERROR");
        System.out.println(isSubsequencefast("acb", "ahbgdc") == false?"SUCCES":"ERROR");
        System.out.println(isSubsequencefast("leeeeetcode", "") == false?"SUCCES":"ERROR");
    }

}
